int run_past_day[13] = {0, 31, 60, 91, 121, 152, 182, 213, 244, 274, 305, 335, 366}; //每个月的天数右端点
int normal_past_day[13] = {0, 31, 59, 90, 120, 151, 181, 212, 243, 273, 304, 334, 365};
string week[7] = {"Saturday", "Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday"};

int main() {
    int day, weekNum, year, mon;
    while (cin >> day) {
        if (day == -1) {
            return 0;
        }
        weekNum = day % 7;
        day++;
        // 寻找年份
        for (year = 0; year <= 7999; year++) {
            if (pastDay[year] >= day) {
                break;
            }
        }
        if (year != 0) {
            day -= pastDay[year - 1];
            if (day == 0) {
                day = pastDay[year] - pastDay[year - 1];  // 防止出现第0天的情况
            }
        }
        // 确定月份
        if (isRun[year]) {
            for (mon = 1; mon <= 12; mon++) {
                if (run_past_day[mon] >= day) {
                    day -= run_past_day[mon - 1];
                    break;
                }
            }
        } else {
            for (mon = 1; mon <= 12; mon++) {
                if (normal_past_day[mon] >= day) {
                    day -= normal_past_day[mon - 1];
                    break;
                }
            }
        }
        printf("%d-%02d-%02d ", year + 2000, mon, day);
        cout << week[weekNum] << endl;
    }
}
